import styles from './Navbar.module.scss';
import Link from 'next/link';

const Navbar = () => (
    <div className={styles.Navbar}>
        <h1>Juliette van Rhyn</h1>
        <ul>
            <li>
                <Link href="/print-design"><a>Print design</a></Link>
            </li>
            <li>
                <Link href="/graphic-design"><a>Graphic design</a></Link>
            </li>
            <li>
                <Link><a>About</a></Link>
            </li>
        </ul>
    </div>
);

export default Navbar;
